Mua 2 sản phẩm cùng màu, cùng size.
Giao: 2 cái cùng size nhưng khác màu;
Tuy 2 cái cùng size nhưng 1 cái vừa, 1 cái chặc;
Giá tốt, giao hàng nhanh

Là món phụ kiện không thể thiếu cho nam giới khi mùa đông về. Tất (vớ) nam Trịnh Trung có các tính năng
👍khử mùi: công nghệ nano bạc diệt khuẩn, chống hôi 99%;
- 95% cotton bamboo (5% spandex đàn hồi, giữ form, không bai, không xù);
